  true,\n\t\"url\": null,\n\t\"notes\": \"This data product summarizes the farm-structural
  characteristics for irrigated farms in the 17 Western States based on USDA's 2008
  and 1998 Farm and Ranch Irrigation Surveys (FRIS) (see the Documentation for data
  sources and methods). The tables are grouped into 16 sections, ranging from total
  irrigation values (for all irrigated farms), to higher efficiency irrigation, to
  irrigated farms receiving financial/technical assistance designed to encourage onfarm
  water and energy conservation. All tables identify specific irrigation characteristics
  for four farm size classes, by State. For more details, see the Summary of Results.\",\n\t\"license_title\":
